import React from 'react';
import { Link } from 'react-router-dom';
import Breadcrumb from 'react-bootstrap/Breadcrumb';


const Nav = () => {
  return (
    <nav>
      <Link to='/'><h3>Home</h3></Link>
        <ul className='nav-links'>
          <li>Username</li>
        </ul>
    </nav>
  )
}

export default Nav;
